import React from 'react'
import styled from "styled-components"

const Wrapper = styled.div`
  min-height:80vh;
  background-color:#24305e;
  padding:30px;
`
const Title = styled.h2`
    color:white;
    width:100%;
    padding:0;
    margin:0;
`;
export default function PreviousPlaylists() {
    return (
        <Wrapper>
            <Title>Archive</Title>
        </Wrapper>
    )
}
